import React, { useState } from 'react';
import LoginContext from './context';
import { Container } from './styles';

function Login() {
    return (
        <Container>
            <h1>Fluxo de clientes</h1>
            <h2>Lojas Brasil</h2>
            <h3>Login</h3>
            <h4>Tipo de acesso</h4>
            <select id="accessKind">
                <option value="local">Loja</option>
                <option value="global">Empresa</option>
            </select>
        </Container>
    );
}

export default Login;
